  input: TEXT,F3A,,"The following is our 'best efforts' procedures for obtaining contributor
    information. Our original solicitations contain a clear and conspicuous request
    for the contributor information and informs the contributor of the requirements
    of federal law for the reporting of such information. Secondly, if we do not receive
    the information we follow-up in writing by mail no later than 30 days after the
    receipt of the contribution requesting the information that is missing. This communication
    only requests the missing information, informs the contributor of the federal
    law requirement and includes a return envelope.  If we still do not receive the
    information we follow-up with a telephone call requesting the information. If
    we receive the missing contributor information we will file with our next regularly
    scheduled report, an amended memo Schedule A listing all the contributions for
    which additional information was received."
